    <script>
        $(document).ready(function() {
            $.ajax({
                type: "GET",
                url: "data/events.xml",
                dataType: "xml",
                success: function(data) {
                    $(data)
                        .find("event")
                        .each(function() {
                            var eventitem = $('<div class="events-item"></div>');
                            eventitem.append(
                                '<p class="event-date">' +
                                $(this)
                                .find("date")
                                .text() +
                                "</p><hr />"
                            );
                            eventitem.append(
                                "<small>" +
                                $(this)
                                .find("time")
                                .text() +
                                "</small>"
                            );
                            var eventcontainer = $('<div class="banner-container"></div>');
                            eventcontainer.append(
                                "<p>" +
                                $(this)
                                .find("title")
                                .text() +
                                "</p>"
                            );
                            if ($(this).find("link").length) {
                                var link = $(this)
                                    .find("link")
                                    .text();
                                eventcontainer.append(
                                    '<p><a class="link" href="' +
                                    link +
                                    '" target="_blank">Read more</a></p>'
                                );
                            }
                            eventitem.append(eventcontainer);
                            $(".events-container").append(eventitem);
                        });

                    // event slick
                    $(".events-container").slick({
                        slidesToShow: 3,
                        focusOnSelect: true,
                        infinite: false,
                        responsive: [{
                                breakpoint: 992,
                                settings: {
                                    slidesToShow: 2
                                }
                            },
                            {
                                breakpoint: 768,
                                settings: {
                                    slidesToShow: 1
                                }
                            }
                        ]
                    });
                },
                error: function(error, text, thrown) {
                    console.log(text);
                }
            });
        });
    </script>
